import React from 'react';
import './slider.css'
const slider = (props) => {
  let temp = [];
  temp.push(props.SliderRange.selected)
  console.log(temp);

    return ( 
        <div className="slidecontainer">
        <input type="range" min="0" max="100" value={props.SliderRange.range} className="slider" id="myRange" onChange={(event) => props.draggged(event)}/>
        <span>{props.SliderRange.range}</span>
        {
          temp.map((element) => {
            return (
              <div>{element}</div>
            )
          })
        }
      </div>
     );
}

export default slider;
